import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  let routes = (
    <Switch>
        <Route path="/" exact component={LandingPage} />
        <Redirect to="/" />
    </Switch>
);

return (
    <div>
        {routes}
    </div>
);
}

export default App;
